() => {
		if (!appsmith.store.roundData) {
			storeValue('roundData', []);
		}

		storeValue('roundData', [
			...appsmith.store.roundData,
			{
				name: roundName.text,
				interviewRounds: roundOrder.text,
				jobDescription: roundDesc.text
			}
		])

		roundName.text = ''
		roundOrder.text = ''

		Query1.run();
	}

